_G.beta = true
if not game:IsLoaded() then
    while not game:IsLoaded() do wait() end
    wait(2)
end;

local function service(n)
    return game:GetService(n)
end

spawn(function()
    while true do
        local ccoff = workspace:FindFirstChild('CCoff')
        if ccoff then
            ccoff:Destroy()
        end
        wait()
    end
end)

